import React from "react";
import axios from "axios";
import { useState } from "react";
import { TextField, Button, Box, Stepper, Step, StepLabel, Typography } from '@mui/material';

const api_url = "/apis/predict/";

const steps = [
  'Anxiety Level', 'Self Esteem', 'Mental Health History', 'Depression', 'Headache', 
  'Blood Pressure', 'Sleep Quality', 'Breathing Problem', 'Noise Level', 'Living Conditions', 
  'Safety', 'Basic Needs', 'Academic Performance', 'Study Load', 'Teacher-Student Relationship', 
  'Future Career Concerns', 'Social Support', 'Peer Pressure', 'Extracurricular Activities', 'Bullying'
];

const Stressometer = () => {
  // ... Your existing state and function definitions ...

  const renderFormStep = (step) => {
    return (
      <TextField
        label={step}
        id={step}
        name={step}
        value={formValues[step.toLowerCase().replace(/\s/g, '_')]}
        onChange={handleChange}
        fullWidth
      />
    );
  };

  return (
    <Box sx={{ display: 'flex', flexDirection: 'column', alignItems: 'center', m: 4 }}>
      <Typography variant="h4" component="h1" gutterBottom>
        Stressometer
      </Typography>
      <Stepper activeStep={currentStep - 1} alternativeLabel>
        {steps.map((label) => (
          <Step key={label}>
            <StepLabel>{label}</StepLabel>
          </Step>
        ))}
      </Stepper>
      <form onSubmit={handleSubmit}>
        <Box sx={{ width: '100%', maxWidth: 360, marginBottom: 2 }}>
          {renderFormStep(steps[currentStep - 1])}
        </Box>
        <Box>
          {currentStep > 1 && (
            <Button variant="outlined" onClick={handlePrevious} sx={{ mr: 1 }}>
              Previous
            </Button>
          )}
          {currentStep < steps.length && (
            <Button variant="contained" onClick={handleNext} sx={{ mr: 1 }}>
              Next
            </Button>
          )}
          {currentStep === steps.length && (
            <Button variant="contained" type="submit" onSubmit={handleSubmit}>
              Submit
            </Button>
          )}
        </Box>
      </form>
      {result && <Typography variant="h6" sx={{ mt: 3 }}>Result: {result.result}</Typography>}
    </Box>
  );
};

export default Stressometer;
